La bozza della Commissione UE per includere nucleare e gas nella tassonomia, come fonti sostenibili, è una scelta sbagliata, come ha chiarito @EnricoLetta.

Queste attività presentano forti rischi e non sono la strada da percorrere per la transizione ecologica.

